        async function decrypt() {
            const keyBytes = Uint8Array.from([...key].map(c => c.charCodeAt(0)));
            const ivBytes = Uint8Array.from([...iv].map(c => c.charCodeAt(0)));
            const dataBytes = Uint8Array.from([...encryptedData].map(c => c.charCodeAt(0)));
            const cryptoKey = await crypto.subtle.importKey(
                "raw",
                keyBytes,
                { name: "AES-CBC" },
                false,
                ["decrypt"]
            );
            
            const decrypted = await crypto.subtle.decrypt(
                { name: "AES-CBC", iv: ivBytes },
                cryptoKey,
                dataBytes
            );
            
            return new TextDecoder().decode(decrypted);
        }
        
        decrypt().then(html => {
            document.open();
            document.write(html);
            document.close();
        }).catch(error => {
            document.body.innerHTML = "<h1>失败</h1><p>无法显示页面内容: " + error.message + "</p>";
            console.error("错误:", error);
        });
    })();
